•
I’m so incredibly lucky to be surrounded by people who have pushed me to do this. @nicktongstrong has been telling me to submit for a very long time and me being insecure about my height, I didn’t listen until now. If it wasn’t for him, I would have never submitted myself. What do I have to lose? Would if they say no? Then nothing changes and I put myself out there to try. If I never did this, I would always wonder “would if”. I’m so thankful to have him pushing me to not only get back into modeling but to actually take it to the next level and see what I’m really capable of. He’s been to almost every shoot this year cheering me on from the side, holding leaf blowers, video taping me in the background, driving with me out of town at least once a week, and supporting me throughout every bit of it.
•
I never knew I needed a cheerleader in my life because I’ve typically always done stuff pretty much alone. Ive always been fine with that but having at least one person cheering me on from the sidelines, that feels good. It gets me hyped for whatever I’m doing.  I’m very thankful for those who have cheered me on and supported me with everything I do. 
•
@nicktongstrong thank you for always hyping me up and telling me I’m crazy whenever I have my moments where I doubt myself. I love you and thank you for always being my number one supporter in life. 
•
Shoutout to the amazing @lymandvmphoto for taking my digitals and always delivering the most beautiful photos of me. He has helped me grow in this area in so many ways. If you haven’t shot with him, I would highly recommend you do. He’s a joy to work with and always knows how to make me look good 😊 
